import { Button, Navbar } from "react-bootstrap";

function Menu() {
    return (
        <>
            <div>

                <h3 style={{ marginTop: "20px" }} className="text-center">Our Menu</h3>
                <hr className="custom-hr" />

            </div>
            <div className="text-center ml-3" > 
            <button className="btn btn-light">All</button>
            <button className="btn btn-light">Breakfast</button>
            <button className="btn btn-light">Lunch</button>
            <button className="btn btn-light">Shake</button>
            <button className="btn btn-light">Dinner</button>
            </div>





        </>
    )
}
export default Menu;
